import React, { Component } from "react"
import "./StarRating.css"


class StarRating extends Component {

    render() {
        return (

            <fieldset class="rating">
                <input type="radio" id="star5" name="rating" value="5" /><label className="full" for="star5" title="Odlican! - 5 zvezdica"></label>
                <input type="radio" id="star4" name="rating" value="4" /><label className="full" for="star4" title="Vrlo dobar - 4 zvezdica"></label>
                <input type="radio" id="star3" name="rating" value="3" /><label className="full" for="star3" title="Ajde da kazem dobar - 3 zvezdice"></label>
                <input type="radio" id="star2" name="rating" value="2" /><label className="full" for="star2" title="Onakooooo - 2 zvezdice"></label>
                <input type="radio" id="star1" name="rating" value="1" /><label className="full" for="star1" title="Jako lose - 1 star"></label>
            </fieldset>

        );
    }

};

export default StarRating;
